Kadetstvo 3 season, 1 - 70-th series (2007) SAT-Rip About a serial: Multiseries film &quot;Kadetstvo&quot; - about a life of children which have a noble purpose, high dream. In fact such concepts as nobleness, a true friendship, patriotism have not died? There are alive at all times such calling as service to the Native land.
It is film about getting older, about the first love, about farewell to the childhood... About mutual relations of children with the adult, real and at times the severe world in which they should live.


